define( [
    "underscore" ,
    "date_utils"
] , 

function( _ ) {

    var helper = {};

    //设置同级下的全部 check 为未选中状态
    //注意 仅仅是看起来
    helper.clearOtherCheck = function( $div ) {
    //{{{
        _.each(
            $div.find( "i" ) , 
            function( el ) { 
                var $el = $( el );
                if( $el.hasClass( "icon-check" ) ) {
                    $el.removeClass( "icon-check" )
                        .addClass( "icon-check-empty" );
                }
            }
        );
    };//}}}

    //反选当前 label 
    helper.reverseCheck = function( $i ) {
    //{{{
        if( $i.hasClass( "icon-check" ) ) {
            $i.removeClass( "icon-check" )
                .addClass( "icon-check-empty" );
        } else {
            $i.removeClass( "icon-check-empty" )
                .addClass( "icon-check" );
        }
    };//}}}

    helper.setCheckByValue = function( $div , value ) {
    //{{{
        if( typeof value === "undefined" ) {
            return;
        }

        valueArray = value.split( " " );

        helper.clearOtherCheck( $div );
        _.each(
            $div.find( ".label" ) ,
            function( label ) {
                var $label = $( label );
                var text = $label.find( ".text" ).text();
                if( _.indexOf( valueArray , text ) !== -1 ) {
                    helper.reverseCheck( $label.find( "i" ) );
                }
            }
        );
    };//}}}
    
    helper.getCheckLabel = function( $div ) {
    //{{{
        var checkLabelTexts = $div.find( ".icon-check" ).parent().find( ".text" );
        return _.reduce( checkLabelTexts , function( memo , text  ) {
            var $text = $( text );
            return memo + " " + $text.text();
        } , "" );
    };//}}}

    //调整时区 并格式化时间
    //传入的时间串为空时 会直接使用当前的本地时间
    helper.resetTime = function( dateString ) {
    //{{{
        //进行一个时区的转换 需要减去 8 小时
        //createAt.getTimezoneOffset() * 60000;
        var date = "";
        if( typeof dateString === "undefined" || dateString === "" ) {
            //似乎本机时间是对的
            var date = new Date();
        } else {
            var date = new Date( dateString );
            date.addMilliseconds( -28800000 );
        }
        return date.toFormat( "YYYY/MM/DD HH24:MI:SS" );
    };//}}}

    helper.showImage = function( $imgs ) {
    //{{{
        var default_src = {
            male:
            //{{{
            "data:image/gif;base64,"
            //}}}
            , female:
            //{{{
            "data:image/gif;base64,"
            //}}}
            , gift:
                //{{{
                "data:image/png;base64,"
                //}}}
            , "default": 
            //{{{
            "data:image/gif;base64,"//}}}
        }
        $imgs.each(
            function( index , el ) {
                var $img = $( el );
                $img.on(
                    "error" ,
                    function() {
                        var alt = $img.attr( "alt" );
                        if( typeof alt === "undefined" || alt === "" || alt === null ) {
                            alt = "default";
                        }
                        $img.attr( "src" , default_src[alt] );
                    } 
                );
                $(el).attr( "src" , $img.attr( "origin_src" ) );
            }
        );
    };//}}}

    helper.removeHTMLTag = function( str ) {
    //{{{
        return str.replace(/<\/?[^>]*>/g,'').replace(/[ | ]*\n/g,'\n').replace(/&nbsp;/ig,'');//去掉&nbsp;
    };//}}}

    helper.isInfoPercentFullfill = function() {
    //{{{
        var percentRequire = 100;

        //关于这个百分比存放的位置
        if( percentRequire !== window.localStorage.getItem( "petal:info_percent_fullfill" ) ) {
            return false;
        } else {
            return true;
        }
    };//}}}

    helper.goToFillInfo = function() {
    //{{{
        //@加上一个判断 如果用户交友信息没有完善也要给予提示
        window.updateSysNotice( "请先完善您的信息" );
        window.router.navigate( "update_self_profile" , {trigger: true} );
    };//}}}

    //重新计算百分比
    //@param userInfo 是需要计算的用户信息 json 对象
    helper.reCalcInfoPercent = function( userInfo ) {
    //{{{
        //用户基本信息
        var basisInfoList = [ "NickName" , "Sex" , "AreaDes" , "SG" , "TZ" , "Age" , "ZY" , "HY" , "TG1" , "HD1" ];

        //交友信息
        var makeFriendsInfoList = [ "MD" , "WM" , "GX" , "XA" , "XQ" , "ZWMS" ];

        //头像
        var avatar = [ "HeadPic" ];

        var infoList = basisInfoList.concat( makeFriendsInfoList.concat( avatar ) );
        var infoListLength = infoList.length;
        var fullfillCount = 0;

        //统计出用户已经完成的信息
        for( var key in userInfo ) {
            if( _.indexOf( infoList , key ) !== -1 && userInfo[key] !== "" ) {
                console.log( userInfo[key]  )
                fullfillCount += 1;
            }
        }

        window.localStorage.setItem( 
            "petal:info_percent_fullfill" , 
            ( fullfillCount / infoListLength ).toFixed( 2 ) * 100 );
    }//}}}

    return helper;
});
